import React from 'react';
import './App.css';

function App() {

  state = {

    name:'Xikmatilla',
      age:23
  };

  return (
    <div className="App">

      <h1>Salom do'stlar</h1>
      <p>{this.state.name}</p>



    </div>
  );
}

export default App;
